import { useState } from 'react';
import PropTypes from 'prop-types';
const FinancialDataComponent = (props) => {
    const [change, setChange] = useState({changeActive: false, changeCapital: false, changeLiability: false, changeEbitda: false, changeLoss: false, changeIncomeTax: false, changePropertyTax: false, changeDividend1: false, changeDividend2: false});
    const activeChange = (e) => {
        props.setActive(e.target.value);
        setChange({changeActive: true, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    console.log(props.activeWatn)
    const capitalChange = (e) => {
        props.setCapital(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: true, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const liabilityChange = (e) => {
        props.setLiability(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: true, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const ebitdaChange = (e) => {
        props.setEBITDA(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: true, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const lossChange = (e) => {
        props.setLoss(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: true, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const incomeTaxChange = (e) => {
        props.setIncomeTax(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: true, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const propertyTaxChange = (e) => {
        props.setPropertyTax(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: true, changeDividend1: change.changeDividend1, changeDividend2: change.changeDividend1});
    }
    const dividend1Change = (e) => {
        props.setDividend1(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: true, changeDividend2: change.changeDividend1});
    }
    const dividend2Change = (e) => {
        props.setDividend2(e.target.value);
        setChange({changeActive: change.changeActive, changeCapital: change.changeCapital, changeLiability: change.changeLiability, changeEbitda: change.changeEbitda, changeLoss: change.changeLoss, changeIncomeTax: change.changeIncomeTax, changePropertyTax: change.changePropertyTax, changeDividend1: change.changeDividend1, changeDividend2: true});
    }
    return (
        <main className="content">
            <div className="content-header">
                <button className="content-header--button">
                    View history of changes
                    <i className="fa-solid fa-arrow-right-from-bracket content-header--icon"></i>
                </button>
            </div>
            <form className="content-form">
                <div className="form-group row">
                    <label
                        htmlFor="comapny"
                        className="col-sm-3 col-form-label"
                    >
                        Cəmi Aktivlər
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            value={props.active}
                            type="number"
                            className={change.changeActive ? 'form-control invalid' : 'form-control'}
                            onChange={activeChange}
                            id="active"
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="segment"
                        className="col-sm-3 col-form-label"
                    >
                        Cəmi Kapital
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            value={props.capital}
                            type="number"
                            className={change.changeCapital ? 'form-control invalid' : 'form-control'}
                            onChange={capitalChange}
                            id="capital"
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label htmlFor="share" className="col-sm-3 col-form-label">
                        Cəmi Öhdəliklər
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            value={props.liability}
                            type="number"
                            className={change.changeLiability ? 'form-control invalid' : 'form-control'}
                            onChange={liabilityChange}
                            id="liability"
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="employee"
                        className="col-sm-3 col-form-label"
                    >
                        EBITDA (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            value={props.ebitda}
                            type="number"
                            className={change.changeEbitda ? 'form-control invalid' : 'form-control'}
                            onChange={ebitdaChange}
                            id="ebitda"
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label htmlFor="ceo" className="col-sm-3 col-form-label">
                        Xalis Mənfəət /(Zərər) (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            value={props.loss}
                            type="number"
                            className={change.changeLoss ? 'form-control invalid' : 'form-control'}
                            onChange={lossChange}
                            id="loss"
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="industry"
                        className="col-sm-3 col-form-label"
                    >
                        Ödənilmiş mənfəət vergisi (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            type="number"
                            className={change.changeIncomeTax ? 'form-control invalid' : 'form-control'}
                            onChange={incomeTaxChange}
                            id="incometax"
                            value={props.incomeTax}
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="country"
                        className="col-sm-3 col-form-label"
                    >
                        Ödənilmiş əmlak vergisi (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            type="number"
                            className={change.changePropertyTax ? 'form-control invalid' : 'form-control'}
                            onChange={propertyTaxChange}
                            id="propertytax"
                            value={props.propertyTax}
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="country"
                        className="col-sm-3 col-form-label"
                    >
                        Bütün təsisçilərə ödənilən dividendlər (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            type="number"
                            className={change.changeDividend1 ? 'form-control invalid' : 'form-control'}
                            onChange={dividend1Change}
                            id="dividend1"
                            value={props.dividend1}
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <label
                        htmlFor="country"
                        className="col-sm-3 col-form-label"
                    >
                        SOCAR-a ödənilən dividendlər (2021)
                    </label>
                    <div className="col-sm-2 flex-div">
                        <input
                            type="number"
                            className={change.changeDividend2 ? 'form-control invalid' : 'form-control'}
                            onChange={dividend2Change}
                            id="dividend2"
                            value={props.dividend2}
                        />
                        <span className="col-sm-1">AZN</span>
                    </div>
                </div>
                <div className="form-group row">
                    <div className="col-sm-12 button-right">
                        <button type="button" className="btn-save">
                            Send
                        </button>
                        <button type="button" className="btn-reset" onClick={props.reset}>
                            Reset
                        </button>
                    </div>
                </div>
            </form>
        </main>
    );
};
FinancialDataComponent.propTypes = {
    active: PropTypes.number,
    capital: PropTypes.number,
    liability: PropTypes.number,
    ebitda: PropTypes.number,
    loss: PropTypes.number,
    incomeTax: PropTypes.number,
    propertyTax: PropTypes.number,
    dividend1: PropTypes.number,
    dividend2: PropTypes.number,
};
export default FinancialDataComponent;
